Dann sprach er: Ich bin der Gott deines Vaters, der Gott Abrahams, der Gott Isaaks, und der Gott Jakobs. Da verhüllte Moses sein Angesicht; denn er wagte nicht aufzuschauen gegen Gott.
Und der Herr sprach zu ihm: Ich habe die Bedrängnis meines Volkes in Ägypten gesehen, und ihre Klagen über die Härte derjenigen gehört, die über die Arbeiten gesetzt sind;
und weil ich seinen Jammer kenne, bin ich herabgekommen, es aus der Gewalt der Ägypter zu erretten und es wegzuführen aus diesem Lande in ein treffliches und weit ausgedehntes Land, in ein Land, das von Milch und Honig fließt, an die Wohnsitze der Chananiter, Hethiter, Amorrhiter, Phereziter, Heviter, und Jebusiter.
